import React from "react";

export default function Bio() {
  const bioStyle = {
    position: "absolute",
    top: "350px",
    maxWidth: "30%",
    maxHeight: "30%",
    // height: "auto",
    backgroundSize: "cover",
    height: "500px",
    backgroundPosition: "center",
    backgroundRepeat: "no-repeat",
    background: "rgba(0,0,0,.3)",
  };

  return (
    <>
      <p style={bioStyle}>
        Bacon ipsum dolor amet pancetta buffalo pork belly beef ribs rump
        tenderloin alcatra. Pancetta ground round rump, prosciutto ham hock
        buffalo flank jerky salami sirloin beef cow turkey. Spare ribs salami
        ball tip strip steak filet mignon meatball pork belly cow pork chop
        shoulder hamburger andouille. Fatback shank swine shoulder, doner pork
        cow picanha ham hock jerky frankfurter tri-tip pancetta. Swine pork chop
        doner, kielbasa shoulder bacon ground round andouille picanha chislic
        tongue. Tenderloin drumstick venison, biltong brisket boudin ball tip
        alcatra. Chislic chuck sausage meatball, capicola corned beef boudin
        salami andouille pork loin hamburger. Beef alcatra chuck pork loin.
        Hamburger bacon drumstick kielbasa pork. Sirloin ground round bacon
        pork, beef ribs ribeye burgdoggen jerky.
      </p>
    </>
  );
}
